import React from "react";
import { Menu } from "semantic-ui-react";
import "../css/App.css";

class Header extends React.Component {
  render() {
    return (
      <Menu secondary>
        <Menu.Item name="Timothy Bell" href="" />
        <Menu.Item name="Home" href="" />
        <Menu.Item name="Resume" href="" />
        <Menu.Item name="Contact Me" href="" />
        <Menu.Item name="messages" href="" />
      </Menu>
    );
  }
}

export default Header;
